import React, { Component } from 'react';
import RotationMakerApp from './components/RotationMaker'
import './App.css';

class App extends Component {
  render() {
    return (
        <RotationMakerApp style={{backgroundColor: "#097392"}}/>
    );
  }
}

export default App;
